class LoginComponent {
    constructor(accountService, router, route, toastr) {
        this.accountService = accountService;
        this.router = router;
        this.route = route;
        this.toastr = toastr;
        this.model = {};
        this.errorMessage = '';
        this.registerMode = false;
        this.loginWithGoogle = () => {
            //this.showError = false;
            this.accountService.signInWithGoogle()
                .then(res => {
                const user = Object.assign({}, res);
                // console.log(user)
                const externalAuth = {
                    provider: user.provider,
                    idToken: user.idToken
                };
                this.validateExternalAuth(externalAuth);
            }, error => console.log(error));
        };
    }
    ngOnInit() {
        this.registerMode = false;
        this.returnUrl = this.route.snapshot.queryParams['returnUrl'] || '/';
    }
    login() {
        this.accountService.login(this.model).subscribe(response => {
            console.log(response);
            this.router.navigateByUrl(this.returnUrl);
            this.toastr.success("LogIn success", "Infomation");
        }, (error) => {
            this.errorMessage = error;
            this.showError = true;
            console.log(this.errorMessage);
        });
    }
    logout() {
        this.accountService.logout();
        this.router.navigateByUrl('/');
        this.toastr.success("LogOut success", "Information");
    }
    gotoRegister() {
        this.router.navigate([]);
    }
    // public loginWithFacebook = () => {
    //   //this.showError = false;
    //   this.accountService.signInWithFaceBook()
    //   .then(res => {
    //     const user: SocialUser = { ...res };
    //           console.log(user)
    //     // this.validateExternalAuth(externalAuth);
    //   }, error => console.log(error))
    // }
    validateExternalAuth(externalAuth) {
        this.accountService.externalLogin(externalAuth)
            .subscribe(res => {
            // localStorage.setItem("token", res.token);
            // this._authService.sendAuthStateChangeNotification(res.isAuthSuccessful);
            // this.router.navigate([this._returnUrl]);
            this.router.navigateByUrl('/stories');
            this.toastr.success("LogIn Success", "Information");
        }, error => {
            this.errorMessage = error;
            this.showError = true;
        });
    }
    registerToggle() {
        this.registerMode = !this.registerMode;
    }
    cancelRegisterMode(event) {
        this.registerMode = event;
    }
    home() {
        this.router.navigateByUrl('/');
    }
}
